import Header from './Header'

const layoutStyle = {
  backgroundColor : "black",
}

export default function Layout(props) {
  return (
    <div style={layoutStyle}>
      <Header />
      {props.children}
      <style jsx>{`
        div
        {
          background-image : url("../static/Waterfall-in-costa-rica.png")
        }
        `}</style>

    </div>
  )
}
